import React, { Component } from "react";
import PageHelmet from "../component/common/Helmet";
import ModalVideo from 'react-modal-video';
import ScrollToTop from 'react-scroll-up';
import { FiChevronUp } from "react-icons/fi";
import Header from "../component/header/HeaderFive";
import Footer from "../component/footer/Footer";
import CallAction from "../elements/callaction/CallAction";
import axios from 'axios';


class ServiceDetails extends Component {
    constructor(props) {
        super(props)
        this.state = {
            isOpen: false,
            title:''
        };
        this.openModal = this.openModal.bind(this)
    }
    openModal() {
        this.setState({ isOpen: true })
    }

    componentDidMount() {
        this.Originalservice();
      }

    Originalservice(){
        
        axios.get('http://localhost:8000/api/originalservices/'+ this.props.match.params.id).then(res => res.data)
        .then(res => {
            this.setState({
                title: res.data.ser
            
            
            });
            
          })
          .catch((error) => {
            console.log(error);
          })
        
    }

  
    render() {
        return (
            <React.Fragment>

                {/* Start Pagehelmet  */}
                <PageHelmet pageTitle='Service Details' />
                {/* End Pagehelmet  */}

                {/* Start Header Area  */}
                <Header headerPosition="header--static logoresize" logo="all-dark" color="color-black" />
                {/* End Header Area  */}

                {/* Start Breadcrump Area */}
                <div className="rn-page-title-area pt--120 pb--190 bg_image bg_image--5" data-black-overlay="5">
                   
                    <div className="container">
                   
                        <div className="row">
                            <div className="col-lg-12">
                            {this.state.items.map(item =>
                                <div className="rn-page-title text-center pt--100" key={item.id}> 
        <h2 className="title theme-gradient">{item.title}</h2>
                                    <p>Fresh From The Press Discription</p>
                                    <div className="header-btn">
                                        <a className="rn-btn" href="https://themeforest.net/checkout/from_item/25457315?license=regular">
                                            <span>Schedule Your FREE Consultation</span>
                                        </a>
                                    </div>
                                </div>
                            )}
                            </div>
                        </div>
                      

                    </div>
                    
                </div>
                {/* End Breadcrump Area */}

                {/* Start Columns Area  */}
                <div className="rn-columns-area ptb--120 bg_color--1">
